# [1178] Number of Valid Words for Each Puzzle
#

# @lc code=start
from typing import List


class Solution:
    def findNumOfValidWords(self, words: List[str], puzzles: List[str]) -> List[int]:
        answers = []
        wordss = self.build_word_map(words)
        words_per_letter = self.build_words_per_letter(wordss)

        return self.find_answers(puzzles, answers, words_per_letter, wordss)

    def build_word_map(self, words):
        m = {}
        for i in range(len(words)):
            w = words[i]
            bm = self.bitmap(w)
            if bm not in m:
                m[bm] = 0
            m[bm] += 1
        return m

    def find_answers(self, puzzles, answers, words_per_letter, wordss):
        for i in range(len(puzzles)):
            p = puzzles[i]
            ps = self.bitmap(p)
            s = 0
            for w in words_per_letter[p[0]]:
                if ps & w == w:
                    s += wordss[w]
            answers.append(s)
        return answers

    def build_words_per_letter(self, wordss):
        words_per_letter = {}
        for letter_code in range(26):
            c = chr(letter_code + ord('a'))
            words_per_letter[c] = []
            for w in wordss.keys():
                bm = 1 << letter_code
                if w & bm == bm:
                    words_per_letter[c].append(w)
        return words_per_letter


    def bitmap(self, s: str) -> int:
        bm = 0
        for c in s:
            bit = ord(c) - ord('a')
            bm |= 1 << bit
        return bm
# @lc code=end

